function onChange(n){HttpGet(`/UserManagement/GetZoneList/?DepartmentId=${n}`,"json",function(n){var i,t;for($("#ZoneId").val("").trigger("change"),i='<option value="">Select<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#ZoneId").html(i)});HttpGet(`/UserManagement/GetBranchList/?DepartmentId=${n}`,"json",function(n){var i,t;for($("#BranchId").val("").trigger("change"),i='<option value="">Select<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#BranchId").html(i)})}function GetListData(){var n=$("#Id").val(),t=$("#DepartmentId").val(),i=$("#ZoneId").val(),r=$("#RoleId").val();return{Id:parseInt(n),DepartmentId:parseInt(t),ZoneId:parseInt(i),RoleId:parseInt(r),BranchId:parseInt($("#BranchId").val())}}$("#btnSaveProfileInfo").click(function(){var n=GetListData(),t=$("#frmUserProfileInfo").valid();t&&HttpPost(`/UserManagement/UpdateProfileDetails`,"json",n,function(){SuccessMessage("Profile Data updated successfully.")})});